import React from "react";

const Home = () => {
  return (
    <div className="home-container">
      <h1>Welcome to Property Management App</h1>
      <p>You are logged in successfully!</p>
      <a href="http://localhost:3000/logout">
        <button>Logout</button>
      </a>
    </div>
  );
};

export default Home;
